\begin{abstract}
We investigate the conceptual generalization capabilities of Transformer architectures on the Symbolic PolyRule Reasoning (SPR) task, where abstract symbol sequences must be classified according to hidden poly-factor generation rules. This task encapsulates complex logical structures and presents a challenging benchmark for neural-symbolic integration. Motivated by successes of recent neural-symbolic methods \citep{graves2014neuraltm,garcez2019neuralsymbolicca,brinkmann2024ama}, we augment Transformers with explicit symbolic reasoning modules and test whether their performance can surpass or match existing approaches. Our experiments on the SPR\_BENCH dataset show that a basic Baseline Transformer reaches a test Macro-F1 of $0.6958$, slightly under the 70\% state-of-the-art. Incorporating symbolic features and gating strategies yields a modest boost to $0.6999$. Our investigation reveals partial improvements and highlights the difficulty of achieving strong generalization in poly-factor rule classification. These findings offer insights into the interplay between neural and symbolic components, underscoring the need for further research to approach robust symbolic reasoning in practice.
\end{abstract}

\section{Introduction}
Symbolic reasoning and logical structure are crucial for many real-world tasks requiring interpretability and reliability. Neural networks, notably Transformers, have shown promise in capturing latent patterns beyond shallow recognition \citep{wang2024thebm,ye2025howdt}. Yet there remain challenges in generalizing from training data to intricate symbolic rules \citep{bortolotti2024anb}. Symbolic PolyRule Reasoning (SPR) represents a rigorous test bed for evaluating such capabilities. The SPR\_BENCH dataset includes sequences of symbols governed by hidden poly-factor rules, reflecting complex dependencies. Transformers, augmented to handle symbolic operations, may offer partial solutions, but it is unclear how effectively they learn and apply such rules.

We present a systematic study of Transformer models extended with symbolic reasoning capabilities to tackle SPR. Our study reveals successes and pitfalls in bridging neural pattern recognition with explicit symbolic modules. We demonstrate that even limited symbolic integration can help, yet improvements are modest, pointing to significant obstacles in multi-factor rule classification.

\section{Related Work}
Deep learning has proven successful on complex tasks \citep{goodfellow2016deep}, but purely connectionist approaches often struggle with explicit logical or symbolic dependencies. Hybrid or neural-symbolic architectures have emerged as an alternative \citep{garcez2019neuralsymbolicca,feldstein2024mappingtn}, leveraging symbolic reasoning within inaccessible representational spaces of deep networks. Tying Transformers with memory-based reasoning \citep{graves2014neuraltm} or multi-step symbolic tasks \citep{brinkmann2024ama} can yield interpretable mechanisms but remains underexplored for poly-factor tasks. Benchmarks emphasizing symbolic rules abound in finance \citep{xie2025finchainas}, geometry \citep{ning2025gnssp}, and language reasoning \citep{jiao2024transformerhn,zhang2023naturalle}, yet systematic evaluations on poly-rule classification are limited. Our contributions extend these directions, focusing on interpretability and partial progress toward bridging the neural-symbolic gap.

