We adopt a Transformer encoder and infuse explicit symbolic features to improve rule classification. A fundamental Baseline model processes each symbol as a token in a character-level embedding. We then integrate symbolic reasoning modules in a second model, computing global synthetic features (e.g., unigram counts, hashed bigram statistics, length normalization). A gating mechanism, partly inspired by prior gating research \citep{genet2025siggateer}, modulates the final hidden Transformer state based on the symbolic embedding. The classification head pools these representations to predict the rule label. While training with cross-entropy, label smoothing and partial regularization are explored to mitigate overfitting.

